# OEIS sequence: A346576

def f(k, digits): return int("".join(map(str, map(lambda x: k%x, digits))))
def aupton(terms):
    alst, k = [], 1
    while len(alst) < terms:
        s = str(k)
        if '0' not in s: alst.append(f(k, list(map(int, s))))
        k += 1
    return alst
